def _partially_consume_prefix(self, prefix, column):
    lines = ['']
    current_column = 0
    current_line = 0
    line_started_with_tab = False

    for char in prefix:
        if char == '\n':
            lines.append('')
            current_column = 0
            current_line += 1
            line_started_with_tab = False
        elif char == ' ':
            current_column += 1
        elif char == '\t':
            current_column += 4
            line_started_with_tab = True
        else:
            if line_started_with_tab:
                lines[current_line] += '\t' * (current_column // 4)
                current_column %= 4
            lines[current_line] += char
            current_column += 1

    if current_column < column:
        return ''.join(lines), prefix[len(''.join(lines)):]
    else:
        return ''.join(lines), prefix
